function addCartPizza(pizzaObj) {
  return {
    type: 'ADD_PIZZAS',
    payload: pizzaObj,
  };
}

function clearCart() {
  return {
    type: 'CLEAR_CART',
  };
}

export { addCartPizza, clearCart };
